import React from 'react';
import Task from './Task';

function TaskList({ tasks, updateTask, deleteTask, toggleComplete }) {
  return (
    <ul>
      {tasks.map((task ,id) => (
        <Task 
          key={id} 
          task={task} 
          updateTask={updateTask} 
          deleteTask={deleteTask} 
          toggleComplete={toggleComplete} 
        />
      ))}
    </ul>
  );
}

export default TaskList;
